    return [(a[0] * b[0] + a[1] * b[2]) % M, (a[0] * b[1] + a[1] * b[3]) % M, (a[2] * b[0] + a[3] * b[2]) % M, (a[2] * b[1] + a[3] * b[3]) % M]

def fibonacci_matrix_power(n):
    e = [1, 0, 0, 1]
    z = [1, 1, 1, 0]
    while n:
        if n % 2 > 0:
            e = matrix_multiply(e, z)
        z = matrix_multiply(z, z)
        n //= 2
    return e[1]

def calculate_d_sequence(n, m):
    I = [1, 1]
    r = fibonacci_matrix_power(m + 2 * n - 2)
    c = 1
    for i in range(2, n):
        I += [(M - M // i) * I[M % i] % M]
